import React from 'react'
import '../styles/PreNavbar.css';
import cartIcon from '../icons/icons';
import { Link } from 'react-router-dom';


const PreNavbaar = () => {
    return (
        <div className="PreNav">
            <div>
                <Link href="https://www.mi.com/in/">XIAOMI INDIA</Link> <span>|</span>
                <Link href="https://in.event.mi.com/in/install-mi-store">GET MI STORE APP</Link> <span>|</span>
                <Link href="https://www.mi.com/in/service/help/#category_id=1&pagenum=1&channel=1">ONLINE HELP</Link> <span>|</span>
                <Link href="https://www.mi.com/in/service/authorized_stores/">RETAIL STORE</Link>
            </div>

            <div>
                <Link href="https://www.mi.com/in/service/authorized_stores/">SIGN IN </Link> <span>|</span>
                <Link href="https://account.xiaomi.com/pass/register?callback=https%3A%2F%2Fstore.mi.com%2Fin%2Flogin%2Fcallback%3Ffollowup%3Dhttps%253A%252F%252Fwww.mi.com%252Fin%26sign%3DNGQyZTY1M2VjNGNjYTc5NzFlZDc1YmY2ZmM2NDFiYWMwNTU5YzUyNQ%2C%2C&sid=i18n_in_pc_pro&_locale=en_IN">SIGN UP</Link> <span>|</span>
                <Link href="https://account.xiaomi.com/pass/register?callback=https%3A%2F%2Fstore.mi.com%2Fin%2Flogin%2Fcallback%3Ffollowup%3Dhttps%253A%252F%252Fwww.mi.com%252Fin%26sign%3DNGQyZTY1M2VjNGNjYTc5NzFlZDc1YmY2ZmM2NDFiYWMwNTU5YzUyNQ%2C%2C&sid=i18n_in_pc_pro&_locale=en_IN">{cartIcon}CART (0)</Link>

            </div>
        </div>
    )
}

export default PreNavbaar
